import "./App.css";
import { motion } from "framer-motion";
import Lead from "./components/Lead";
import About from "./components/Aboutme";
import Experience from "./components/Experience";
import Timeline from "./components/Timeline";
import Skills from "./components/Skills";
import { Button } from "@material-ui/core";
import MailMe from "./components/Emailme";
import Footer from "./components/Footer";
import Map from "./components/Map";
import Navbar2 from "./components/Navbar2";
import "./styles/NavBar2.css";
import { BrowserRouter as Router, Switch, NavLi } from "react-router-dom";

// import { InfoData, InfoDataTwo } from './InfoData';

function App() {
  return (
    <div className="App">
      {/* <motion.div
        className="title"
        initial={{ position: "relative", top: -250 }}
        animate={{ top: -10 }}
        transition={{ delay: 1, type: "spring", stiffness: 300 }}
        default={{ duration: 18 }}
      ></motion.div> */}
      <Router>
        <Navbar2 />

        <Switch>
          <Route path="/" exact component={Lead} active={{color: "white"}} />
          <Route path="/about" exact component={About}  active={{color: "white"}} />
          <Route path="/experience" exact component={Timeline}  active={{color: "white"}} />
          <Route path="/skills" exact component={Skills}  active={{color: "white"}} />
          <Route path="/mailme" component={MailMe}  active={{color: "white"}} />
        </Switch>
        {/* <Map /> */}
      </Router>
      <Footer />
    </div>
  );
}

export default App;
